package sets;
import java.util.*;

public class LinkedHashSetDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//to arrange the collection in the way i have add the elements we use LinkedHashMap
		Set<Integer> ls = new LinkedHashSet<>();
		ls.add(69);
		ls.add(56);
		ls.add(6);
		ls.add(9);
		ls.add(45);
		System.out.println(ls);
		
		

	}

}
